import React from 'react';

class Add extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            activeTab: "FLIGHT"
        }
    }

    renderTabs() {
        return (
            <div class="tabs">
                <button class="tab" onClick={this.setState({activeTab: 'FLIGHT'})}>London</button>
                <button class="tab" onClick={this.setState({activeTab: 'EVENT'})}>Paris</button>
                <button class="tab" onClick={this.setState({activeTab: 'SCHEDULE'})}>Tokyo</button>
            </div>
        )
    }
    render() {
        return(
            <div>
                {this.renderTabs()}
                <p>Hello World</p>
            </div>

        )
    }
}

export default Add;
